import React, { useState } from 'react';
import BikeCard from '../components/BikeCard';

const bikeData = [
  { id: 1, model: 'Royal Enfield Classic', price: 800, imageUrl: 'https://example.com/enfield.jpg', location: 'Hyderabad' },
  { id: 2, model: 'Honda Activa', price: 400, imageUrl: 'https://example.com/activa.jpg', location: 'Chennai' },
  { id: 3, model: 'Yamaha FZ', price: 500, imageUrl: 'https://example.com/yamaha.jpg', location: 'Hyderabad' },
];

function BookBike() {
  const [location, setLocation] = useState('');
  const [selectedDate, setSelectedDate] = useState('');
  
  const filteredBikes = bikeData.filter(bike => 
    bike.location.toLowerCase().includes(location.toLowerCase())
  );

  return (
    <div>
      <h2 className="text-2xl font-bold text-blue-600 dark:text-blue-300 mb-4">ðŸ“… Book Your Ride</h2>
      <div className="flex gap-4 mb-4">
        <input type="text" placeholder="Location" value={location} onChange={e => setLocation(e.target.value)} className="px-3 py-2 border rounded dark:bg-gray-800 dark:text-white" />
        <input type="date" value={selectedDate} onChange={e => setSelectedDate(e.target.value)} className="px-3 py-2 border rounded dark:bg-gray-800 dark:text-white" />
      </div>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredBikes.map(bike => <BikeCard key={bike.id} bike={bike} />)}
        {filteredBikes.length === 0 && <p>No bikes found for that location.</p>}
      </div>
    </div>
  );
}

export default BookBike;
